import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <p>&copy; 2024 Paradise Nursery</p>
      <p>Address: 123 Green St, Plant City, FL</p>
      <p>Phone: (123) 456-7890</p>
      <p>Email: contact@paradisenursery.com</p>
    </footer>
  );
};

export default Footer;
